import './App.css';
import {useState,useEffect} from 'react';
import axios from 'axios'
import { BarChart } from '@mui/x-charts/BarChart';

function App() {
  let [data,setData] = useState(null)
  useEffect(()=>{
    axios.get("http://api.open-meteo.com/v1/forecast?latitude=32.73&longitude=-97.10&current=temperature_2m,wind_speed_10m&hourly=temperature_2m,relative_humidity_2m,wind_speed_10m").then((response)=>{
      console.log(response.data)
      setData(response.data)
    })
  },[]);

  const uData = [4000, 3000, 2000, 2780, 1890, 2390, 3490];
const pData = [2400, 1398, 9800, 3908, 4800, 3800, 4300];
const xLabels = [
  'Page A',
  'Page B',
  'Page C',
  'Page D',
  'Page E',
  'Page F',
  'Page G',
];

  return (
    <div className="App">
      <header className="App-header">
      <h1>Current Temperature {data?data.current.temperature_2m:''} {data?data.current_units.temperature_2m:''}</h1>
      <h1>Current Wind Speed {data?data.current.wind_speed_10m:''}  {data?data.current_units.wind_speed_10m:''}</h1>
      <BarChart
  width={500}
  height={300}
  series={[
    { data: pData, label: 'pv', id: 'pvId' },
    { data: uData, label: 'uv', id: 'uvId' },
  ]}
  xAxis={[{ data: xLabels, scaleType: 'band' }]}
/>
      </header>
    </div>
  );
}

export default App;
